         PRINT NOGEN                                                            
***********************************************************************         
*  Fix tables for Cli/Prod/Job using ledgers SJ,SR                    *         
***********************************************************************         
         SPACE 1                                                                
         USING ACWORKD,RC                                                       
         USING ACRLD,RA                                                         
         USING ACRL2D,R7                                                        
         NMOD1 0,**TBFX**,R8                                                    
         L     RC,RLBASEC          1ST STORAGE AREA                             
         L     R7,AACRL2D          2ND STORAGE AREA                             
         CLI   MODE,RUNFRST        RUN FIRST                                    
         BE    TABRUN                                                           
         CLI   MODE,REQFRST        REQUEST FIRST                                
         BE    TABREQF                                                          
         CLI   MODE,REQLAST        BACK TO REQUEST FIRST                        
         BE    TABREQL                                                          
         DC    H'0'                MODE NOT VAILD                               
*                                                                               
         USING PARSED,R4                                                        
         USING KYWD,R6                                                          
TABRUN   MVC   AUPCASE,=A(CTRYXLAT)     Tables in FACTRYXLAT                    
         MVC   AEQVPOOL,=A(EQVPOOL)     Built parse entries                     
         MVC   AADJPOOL,=A(ADJPOOL)                                             
         MVC   AREQTAB,=A(REQTAB)                                               
         MVC   AREQLIST,=A(REQLIST)                                             
         MVC   AREQITEM,=A(REQITEMS)                                            
         MVC   ACCNLIST,=A(CCNLIST)                                             
         MVC   ACCNTAB,=A(CCNTAB)                                               
         TM    DDLNKIND,DDLNKINT        DDLINK initialized ?                    
         BO    TABRUN06                                                         
         MVC   ALOADTAB,=A(LOADTAB)                                             
         MVC   SETCNTR,=A(SETCON)                                               
         MVC   GETLDGR,=A(LDGLIST)                                              
         L     RF,AADJPOOL                                                      
         XC    0(ADJLNQ,RF),0(RF)  Clear first entry first time                 
                                                                                
         L     R1,=A(RELOTAB)                                                   
TABRUN01 L     RE,0(,R1)           LOAD IN DISPLACMENT OF TABLE                 
         L     RF,4(,R1)           LOAD IN DISPLACMENT IN ACRLD                 
         AR    RE,RB               ADD IN BASE OF ACRL05                        
         AR    RF,RA               ADD IN BASE OF ACRLD                         
         ST    RE,0(,RF)           SAVE OFF ADDRESS                             
         LA    R1,8(,R1)           NEXT ENTRY                                   
         CLI   0(R1),EOT           END OF TABLE                                 
         BNE   TABRUN01                                                         
                                                                                
         L     R1,=A(RELOKYW)      RELOCATE KEYWORDS NEEDED                     
TABRUN03 SR    RE,RE                                                            
         ICM   RE,3,0(R1)          LOAD IN DISPLACMENT TO KEYWORD               
         LH    RF,2(,R1)           LOAD IN DISPLACMENT TO ACRLD                 
         A     RE,KYWBASE                                                       
         AR    RF,RA                                                            
         ST    RE,0(,RF)           SAVE OFF ADDRESS                             
         LA    R1,4(,R1)           NEXT ENTRY                                   
         CLI   0(R1),EOT           END OF TABLE                                 
         BNE   TABRUN03                                                         
*                                                                               
         L     R1,=A(RELOPRS)      RELOCATE PARSE ENTRIES NEEDED                
TABRUN04 SR    RE,RE                                                            
         ICM   RE,3,0(R1)          LOAD IN DISPLACMENT TO PARSE ENTRY           
         LH    RF,2(,R1)           LOAD IN DISPLACMENT TO ACRLD                 
         A     RE,PRSBASE                                                       
         AR    RF,RA                                                            
         ST    RE,0(,RF)           SAVE OFF ADDRESS                             
         LA    R1,4(,R1)           NEXT ENTRY                                   
         CLI   0(R1),EOT           END OF TABLE                                 
         BNE   TABRUN04                                                         
*                                                                               
TABRUN06 LA    R1,LOADINT+LOADCLR                                               
         TM    DDLNKIND,DDLNKON+DDLNKINT                                        
         BNO   *+8                                                              
         LA    R1,LOADCLR+LOADRSET                                              
         GOTO1 ALOADTAB                                                         
*                                                                               
         BRAS  RE,RESETPRS         Reset parse entries                          
*                                                                               
         USING LDGD,R2                                                          
TABRUN09 GOTO1 GETLDGR,DMCB,=C'SJ'                                              
         ICM   R2,15,DMCB                                                       
         BNZ   TABRUN10                                                         
         MVI   SJCLILEN,3          DEFAULT TO 3                                 
         MVI   SJPRDLEN,3          DEFAULT TO 3                                 
         MVI   SJJOBLEN,6          DEFAULT TO 6                                 
         MVI   SJPRDDSP,3          DEFAULT TO 3                                 
         MVI   SJJOBDSP,6          DEFAULT TO 6                                 
         B     TABRUN20                                                         
*                                                                               
TABRUN10 MVC   SJCLILEN,LDGLVQ1                                                 
         MVC   SJPRDLEN,LDGLVQ2                                                 
         MVC   SJPRDDSP+1(1),LDGLEV1              LEVEL 1                       
         MVC   SJJOBLEN,LDGLVQ3    JOB     LENGTH                               
         CLI   LDGLVQ3,6           IS IT > MAX JOB LENGTH ?                     
         BNH   *+8                 NO                                           
         MVI   SJJOBLEN,6          SET TO  MAX JOB LENGTH                       
         MVC   SJJOBDSP+1(1),LDGLEV2              LEVEL 2                       
*                                                                               
         XC    SJAEUSED,SJAEUSED    Levels into SJINFO table                    
         MVI   SJAEDSPA,0           To look for SJ account                      
         ZIC   R0,LDGAE_A           Equivalents                                 
         STC   R0,SJAEDSPB                                                      
         ZIC   R1,LDGAE_B                                                       
         AR    R0,R1                                                            
         STC   R0,SJAEDSPC                                                      
         ZIC   R1,LDGAE_C                                                       
         AR    R0,R1                                                            
         STC   R0,SJAEDSPD                                                      
         ZIC   R1,LDGAE_D                                                       
         AR    R0,R1                                                            
         STC   R0,SJAEDSPE                                                      
                                                                                
*---------------------------------------------------------------------*         
* Make adjustment to CLI/PRD/JOB entries in keywords and parse tables *         
*---------------------------------------------------------------------*         
TABRUN20 LA    R3,ADJTAB           ADJUSTMENT TO KEYWORD TABLES                 
TABRUN21 CLI   0(R3),EOT           End of table ?                               
         BE    TABRUN60            Yes                                          
         SR    R0,R0               R0=displacement                              
         SR    R1,R1               R1=length                                    
         SR    RF,RF                                                            
*                                                                               
TABRUN24 TM    0(R3),ADJCLI        Client level ?                               
         BZ    *+10                No                                           
         IC    R1,SJCLILEN                                                      
         AR    RF,R1                                                            
         TM    0(R3),ADJPRD        PRODUCT LEVEL?                               
         BZ    *+10                                                             
         IC    R1,SJPRDLEN                                                      
         AR    RF,R1                                                            
         TM    0(R3),ADJJOB        JOB LEVEL?                                   
         BZ    *+10                                                             
         IC    R1,SJJOBLEN                                                      
         AR    RF,R1               COMBINED LENGHTS                             
         LR    R1,RF               RESET R1 = LENGTH TO USE                     
*                                                                               
         SR    RF,RF                                                            
         TM    0(R3),ADJCLDSP      DISPLACEMENT LEN OF CLIENT                   
         BZ    *+8                                                              
         IC    R0,SJCLILEN                                                      
         TM    0(R3),ADJPRDSP      DISPLACEMENT LEN OF PRD                      
         BZ    *+8                                                              
         IC    RF,SJPRDLEN                                                      
         AR    R0,RF               L'CLI OR L'PRD OR L'CLI+L'PRD                
*                                                                               
         L     R4,0(,R3)           GET POSSIBLE PARSE ENTRY                     
         TM    0(R3),ADJKEY                                                     
         BZ    TABRUN25                                                         
         LR    R6,R4               R4 WAS KEYWORD ENTRY NOT PARSE               
         STC   R1,KYWSRTQ+1        SORT DATA LENGTH FOR ENTRY                   
         SR    R4,R4                                                            
         ICM   R4,3,KYWPRSE                                                     
         BZ    TABRUN30                                                         
         A     R4,PRSBASE          ALSO ADJUST PARSE LENGTHS                    
*                                                                               
TABRUN25 ST    R4,SVR4             Store start parse entry                      
         TM    0(R3),ADJJOB+ADJPRD+ADJCLI                                       
         BZ    TABRUN27                                                         
         TM    0(R3),ADJEST                                                     
         BO    TABRUN27            Not for estimate                             
         BRAS  RE,FIXLEN           R1=LENGTH                                    
                                                                                
TABRUN27 L     R4,SVR4             Re-load start parse entry                    
         TM    0(R3),ADJCLDSP+ADJPRDSP                                          
         BZ    TABRUN30            GET NEXT                                     
         GOTOR FIXDSP,DMCB,(R0),0  R0=adjustment amount                         
*                                                                               
TABRUN30 LA    R3,4(,R3)           BUMP TO NEXT ENTRY                           
         B     TABRUN21                                                         
                                                                                
*---------------------------------------------------------------------*         
* Fix up the first 3 entries of the table for cli/prd/job             *         
*---------------------------------------------------------------------*         
         USING CURD,R3                                                          
TABRUN60 L     R3,CURBASE                                                       
         MVC   CURVARLN,SJCLILEN   Length of client                             
         LHI   R1,CURSJACC-ACRLD   Start of cli/prd/job                         
         AH    R1,SJCLIDSP         Add displacement to client                   
         STH   R1,CURVAR           Save new client locatin in table             
                                                                                
         AHI   R3,CURLNQ           Next entry                                   
         MVC   CURVARLN,SJPRDLEN   Save off length of product                   
         LHI   R1,CURSJACC-ACRLD   Start of cli/prd/job                         
         AH    R1,SJPRDDSP         Add displacement to product                  
         STH   R1,CURVAR           Save new product location in table           
                                                                                
         AHI   R3,CURLNQ           Next entry                                   
         MVC   CURVARLN,SJJOBLEN   Save off length of job                       
         LHI   R1,CURSJACC-ACRLD   Start of cli/prd/job                         
         AH    R1,SJJOBDSP         Add displacement to job                      
         STH   R1,CURVAR           Save new job location in table               
                                                                                
*---------------------------------------------------------------------*         
* Fix up parse entry for client location in SR contra                 *         
*---------------------------------------------------------------------*         
         GOTO1 GETLDGR,DMCB,=C'SR'                                              
         ICM   R2,15,DMCB                                                       
         BZ    TABRUN65                                                         
         L     R4,=A(PRSCLISR)     If contra SR                                 
         SR    RF,RF                                                            
         ICM   RF,1,LDGCLIP        Client position in key                       
         BZ    TABRUN65            Not set                                      
         SHI   RF,1                Adjust by one                                
         BZ    TABRUN65            Nothing really to adjust                     
         SR    RE,RE                                                            
         ICM   RE,3,=S(CURSUBAC+3)                                              
         AR    RE,RF                                                            
         STCM  RE,3,PARBASE                                                     
                                                                                
*---------------------------------------------------------------------*         
* Set OFFPOS1C, possible deactivate entries or amend base on CLIPOS   *         
*---------------------------------------------------------------------*         
TABRUN65 GOTO1 GETLDGR,DMCB,=C'1C'                                              
         XC    OFFPOS1C,OFFPOS1C   Initialize                                   
         ICM   R2,15,DMCB                                                       
         BZ    TABRUN70                                                         
         MVC   OFFPOS1C,LDGOFFP    Save 1C OFFPOS                               
         NI    OFFPOS1C,X'FF'-X'40'                                             
         L     R4,=A(PRSCLC1C)     If contra 1C                                 
         GOTOR SAVEPRS,(R4)                                                     
         SR    RF,RF                                                            
         ICM   RF,1,LDGCLIP        Level of client                              
         BNZ   TABRUN68                                                         
         XC    PARLDGRS,PARLDGRS   De-activate entry                            
                                                                                
         L     R4,=A(PRSCLA1C)     If 1C account                                
         GOTOR SAVEPRS,(R4)                                                     
         XC    PARLDGRS,PARLDGRS   De-activate entry                            
         B     TABRUN70                                                         
*                                                                               
TABRUN68 SHI   RF,1                Adjust by one                                
         BZ    TABRUN70            Nothing to really adjust                     
         SR    RE,RE                                                            
         ICM   RE,3,PARBASE                                                     
         AR    RE,RF                                                            
         STCM  RE,3,PARBASE                                                     
*                                                                               
         L     R4,=A(PRSCLA1C)     IF 1C ACCOUNT                                
         ICM   RE,3,PARBASE                                                     
         AR    RE,RF                                                            
         STCM  RE,3,PARBASE                                                     
*                                                                               
TABRUN70 DS    0H                                                               
         BAS   RE,SETAEQV          Set account equivalent for SJ                
*                                                                               
TABRUN90 B     TABXIT                                                           
         DROP  R2                                                               
         EJECT                                                                  
***********************************************************************         
*  MAKE ADJUSTMENT TO ACCOUNT LEVELS                                  *         
***********************************************************************         
         SPACE 1                                                                
         USING KYWD,R6                                                          
         USING PARSED,R4                                                        
TABREQL  MVC   PREVLDG,SPACES                                                   
*                                                                               
TABREQF  CLC   PREVLDG,QUNIT                                                    
         BE    TABXIT              SAME UNIT, NO NEED TO ADJUST TABLES          
*        MVC   CULSET,=X'FFFF'     Contra UL set to init. in A(SETCNTR)         
         MVC   PREVLDG,QUNIT                                                    
*                                                                               
*---------------------------------------------------------------------*         
* Make adjustment to NARALL keyword for Person report                 *         
*---------------------------------------------------------------------*         
         TM    DDLNKIND,DDLNKON+DDLNKQKR TEST ACCENT OR QUICK REPORT            
         BZ    TABREQ04                  NO - OK                                
*                                                                               
         L     R6,=A(KYWNARA)      NARALL KEYWORD TABLE (UK ONLY)               
         TM    DDLNKIND,DDLNKON+DDLNKQKR TEST ACCENT OR QUICK REPORT            
         BZ    TABREQ00                                                         
         MVC   KYWSRTQ,=AL2(150)   SET LENGTH TO 150                            
         CLC   PERSUL,QUNIT        TEST PERSON REPORT                           
         BNE   *+10                                                             
         MVC   KYWSRTQ,=AL2(100)   YES - SET LENGTH TO 100                      
         B     TABREQ04            DONE FOR 1R LEDGER                           
*                                                                               
TABREQ00 L     R4,=A(PRSNARA)      NARALL PARSE TABLE                           
         B     *+12                                                             
TABREQ02 CLI   PARTYPE,EOT                                                      
         BE    TABREQ04            END OF TABLE                                 
*                                                                               
         CLC   PARLDGRS,=AL4(PAR_1R)                                            
         BNE   *+10                                                             
         MVC   PARTOLEN,=H'150'    YES - SET LENGTH TO 150                      
         LA    R4,PARSEDQ(,R4)     NEXT PARSE ENTRY                             
         B     TABREQ02                                                         
*                                                                               
TABREQ04 BRAS  RE,RESETPRS            Reset parse entries                       
         BAS   RE,SETAEQV          Set account equivalent levels                
         L     R6,=A(KYWREV$)                                                   
         MVI   KYWIND3,KYWTRNS     Default for tranaction processing            
         MVI   KYWIND4,0           Default value                                
         MVI   KYWREAD,0           Default value                                
         MVI   KYWLVLQ,0           Default value                                
         CLI   QPROG,PNL                                                        
         BNE   TABREQ05                                                         
         MVI   KYWIND3,KYWSUBA     Reset for sub-account processing             
         MVI   KYWIND4,KYWBUK      Reset for bucket processing                  
         MVI   KYWREAD,KYWCST$     Reset for allocated data                     
         MVI   KYWLVLQ,X'FF'       Reset for all bucket types                   
*                                                                               
         USING ACLVD,R3                                                         
*&&US*&& USING PARSED,R4                                                        
TABREQ05 LA    R3,LDGRTAB          SET REQUESTED UNIT/LEDGER                    
TABREQ06 CLI   0(R3),EOT           END OF TABLE?                                
         BNE   *+6                                                              
         DC    H'0'                NOT A VALID LEDGER                           
         CLC   QUNIT(2),1(R3)                                                   
         BE    TABREQ08                                                         
         LA    R3,10(,R3)                                                       
         B     TABREQ06            NO                                           
*                                                                               
TABREQ08 MVC   CURLDGR,3(R3)       SET REQUEST U/L                              
         MVC   CNTRAUL,7(R3)                                                    
         MVC   BRNCHSGN,9(R3)      BRANCH CONDITION TO REVERSE SIGN             
*                                                                               
         USING LDGD,R5                                                          
         SR    R5,R5                                                            
         LA    R3,ACLVTAB                                                       
TABREQ10 CLI   ACLVD,EOT           END OF TABLE?                                
         BE    TABREQ20            FINISHED                                     
         MVC   WORK(4),CURLDGR                                                  
         NC    WORK(4),ACLVREP     TEST IF KEYWORD USED FOR                     
         BZ    TABREQ19            THIS U/L                                     
*                                                                               
         SR    RE,RE                                                            
         ICM   RE,3,ACLVLDG        S(0) ADDRESS TO U/L TO PROCESS               
         LR    RF,RE                                                            
         N     RE,=X'00000FFF'     FILTER 3 BYTES TO GET DISPLACEMENT           
         SRL   RF,12               SINGLE OUT BASE REGISTER                     
         EX    RF,*+8              RE=A(0) CONVERTED FROM S(0)                  
         B     *+6                                                              
         AR    RE,0                ADD BASE REGISTER IN RF                      
         CLI   0(RE),C' '                                                       
         BNH   TABREQ19            LOOP TO NEXT, NOT VALID UNIT/LEDGER          
         ICM   R6,15,ACLVKYW       POINT TO KEYWORD                             
         LTR   R5,R5                                                            
         BZ    *+14                                                             
         CLC   LDGUL,0(RE)         DO WE ALREADY HAVE UNIT/LEDGER?              
         BE    TABREQ17            YES                                          
***********************************************************************         
*  Get ledger record                                                  *         
***********************************************************************         
         SPACE 1                                                                
         XC    LEVLEN,LEVLEN       CLEAR LEVEL LENGTHS                          
         GOTO1 GETLDGR,DMCB,(RE)                                                
         ICM   R5,15,DMCB                                                       
         BNZ   TABREQ17                                                         
         TM    ACLVIND,ACLVSET     MUST SET UNIT/LEDGER?                        
         BZ    TABREQ19            LOOP TO NEXT                                 
         CLC   QAPPL,=C'@DCHEK      ' Skip Die for format @DCHEK                
         BE    TABREQ19                                                         
         DC    H'0'                DIE MUST HAVE UNIT/LEDGER                    
*                                                                               
TABREQ17 MVC   LEV1LN,LDGLEV1      lev1ln-4 will have main ldg levels           
         MVC   LEV2LN,LDGLEV2      when finished                                
         MVC   LEV3LN,LDGLEV3                                                   
         MVC   LEV4LN,LDGLEV4                                                   
         CLC   ACLVLEV,LDG#LEVS    WHAT LEVEL CAN WE GO TO                      
         BH    TABREQ19                                                         
         SR    R1,R1                                                            
         IC    R1,ACLVLEV          GET LEVEL                                    
         BCTR  R1,0                                                             
         MHI   R1,(LDGLEV2-LDGLEV1)                                             
         LA    R2,LDGLEV1(R1)      POINT TO LEVEL DATA                          
         SR    RE,RE                                                            
         IC    RE,ACLVADJ          ADJUST LENGTH FOR U/L                        
         LA    RF,12               MAX OUT                                      
         CLI   0(R2),0             DOES LEVEL EXISTS?                           
         BE    *+8                 NO, LOOP                                     
         IC    RF,0(,R2)           LENGTH OF ACCOUNT                            
*                                                                               
         AR    RE,RF                                                            
         MVC   KYWLVLQ,1(R2)                                                    
         SR    R4,R4                                                            
         ICM   R4,3,KYWPRSE                                                     
         BZ    TABREQ19                                                         
         A     R4,PRSBASE          GET PARSE INFO FOR LEVEL ONE                 
         LA    RF,2(,RF)           ADD 2 TO ALLOW FOR UNIT/LEDGER               
         STC   RF,KYWSRTQ+1        PUT SIZE INTO KYWDBASE TABLE                 
         CLI   MULTLDG,YES         SINCE MULTLEDGER LEVELS MAY VARY             
         BNE   *+8                 FORCE SORTREC LENGTH TO MAX OF 12            
