***********************************************************************         
*  Account equivalences setup                                                   
***********************************************************************         
         USING LDGD,R2                                                          
         USING KYWD,R6                                                          
SETAEQV  NTR1                                                                   
         CLI   MODE,RUNFRST                                                     
         BNE   SETAE15                                                          
                                                                                
*---------------------------------------------------------------------*         
* Build SJ account equivalences in EQVPOOL area                       *         
*---------------------------------------------------------------------*         
         USING PARSED,R5                                                        
         L     R4,=A(AESJTAB)      Reset keyword entries                        
         L     R5,AEQVPOOL                                                      
         SR    R0,R0                                                            
SETAE08  LA    R1,10                                                            
SETAE10  CLI   0(R4),EOT           End of table                                 
         BE    SETAE12             Finished                                     
         L     R3,PRSBASE                                                       
         LR    RF,R5                                                            
         SR    RF,R3               Find displacement to entry                   
         L     R6,0(,R4)           Load keyword entry                           
         STCM  RF,3,KYWPRSE                                                     
         MVC   0(PARSEDQ,R5),SJAEQV                                             
         STC   R0,PARTTYP2         Level A to E as 0 to 4                       
         ST    R5,SVR5                                                          
                                                                                
         AHI   R5,PARSEDQ                                                       
         MVI   0(R5),EOT                                                        
         AHI   R5,4                Keep it on a boundary                        
                                                                                
         SR    RE,RE                                                            
         ICM   RE,3,KYWLINK        Name not supported                           
         BZ    SETAE11                                                          
         A     RE,KYWBASE                                                       
         LR    R6,RE               Name keyword                                 
         LR    RF,R5                                                            
         SR    RF,R3               Find Displacement to entry                   
         STCM  RF,3,KYWPRSE                                                     
         MVC   0(PARSEDQ,R5),SJAEQVN                                            
         MVC   PARADDR,SVR5        Set code pointer                             
*        MVI   PARTTYP1,1          Indication name for SJ                       
         STC   R0,PARTTYP2         Level A to E as 0 to 4                       
         AHI   R5,PARSEDQ                                                       
         MVI   0(R5),EOT                                                        
*&&UK*&& AHI   R5,4                Keep it on a boundary                        
                                                                                
SETAE11  AHI   R4,4                Next entry                                   
         BCT   R1,SETAE10                                                       
                                                                                
         AHI   R0,1                                                             
         B     SETAE08                                                          
                                                                                
SETAE12  ST    R5,AEQVPOOL         SJ set only once                             
         B     SETAE40                                                          
                                                                                
*---------------------------------------------------------------------*         
* Build account equivalencies in EQVPOOL area                         *         
*---------------------------------------------------------------------*         
SETAE15  L     R4,=A(AEULTAB)      Build for each request                       
         L     R5,AEQVPOOL                                                      
                                                                                
         SR    R0,R0               Level of group set from 0 to 4               
SETAE18  LA    R1,10               Ten entries in a group                       
SETAE20  CLI   0(R4),EOT           End of table                                 
         BE    SETAE40             Finished                                     
         LR    RF,R5                                                            
         S     RF,PRSBASE          Find displacement to entry                   
         L     R6,0(,R4)           Load keyword entry                           
         STCM  RF,3,KYWPRSE                                                     
         CLI   QPROG,GENERAL       General ledger                               
         BNE   *+8                 No,  SKIP                                    
         OI    KYWIND4,KYWOKREV    Set ok to reverse bit in keyword tab         
         MVC   0(PARSEDQ*5,R5),ACAEQV                                           
         ST    R5,SVR5             A(First parse entry of group)                
                                                                                
         LA    RF,5                                                             
SETAE22  STC   R0,PARTTYP2         Level A to E as 0 to 4                       
         AHI   R5,PARSEDQ                                                       
         BCT   RF,SETAE22                                                       
                                                                                
         MVI   0(R5),EOT           Mark end of parse entries                    
         AHI   R5,4                Keep it on a boundary                        
                                                                                
         SR    RE,RE                                                            
         ICM   RE,3,KYWLINK        Get to name entry                            
         BZ    SETAE24             Not supported                                
         A     RE,KYWBASE                                                       
         LR    R6,RE               R6 = A(Name keyword)                         
         LR    RF,R5                                                            
         S     RF,PRSBASE          Find displacement to entry                   
         STCM  RF,3,KYWPRSE                                                     
         CLI   QPROG,GENERAL       General ledger                               
         BNE   *+8                 No,  SKIP                                    
         OI    KYWIND4,KYWOKREV    Set ok to reverse bit in keyword tab         
         MVC   0(PARSEDQ,R5),ACAEQVN    NAME ENTRY                              
         STC   R0,PARTTYP2         Level A to E                                 
         MVC   PARADDR,SVR5        Point to code parse entry                    
         AHI   R5,PARSEDQ                                                       
         MVI   0(R5),EOT           Mark end of entry                            
         AHI   R5,4                Keep it on a boundary                        
         DROP  R5                                                               
                                                                                
SETAE24  AHI   R4,4                Next entry                                   
         BCT   R1,SETAE20                                                       
                                                                                
         AHI   R0,1                                                             
         B     SETAE18                                                          
                                                                                
*ETAE25  ST    R5,AEQVPOOL                                                      
                                                                                
*---------------------------------------------------------------------*         
* Make adjustments to parse built parse entries                       *         
*---------------------------------------------------------------------*         
SETAE40  L     R4,=A(AESJTAB)      Account equivalent table                     
         LA    RE,=C'SJ'                                                        
         XC    SJADJMNT,SJADJMNT                                                
         CLI   MODE,RUNFRST        Only process SJ in RUNFIRST                  
         BE    SETAE42                                                          
         L     R4,=A(AEULTAB)                                                   
         LA    RE,QUNIT                                                         
*                                                                               
SETAE42  GOTO1 GETLDGR,DMCB,(RE)                                                
         ICM   R2,15,DMCB          R2 = LDGD DSECT                              
         BZ    SETAEVX             Try another                                  
         LA    R7,LDGAELVS                                                      
*                                                                               
SETAE50  CLI   0(R4),EOT           End of table ?                               
         BZ    SETAE90             Finished                                     
         SR    R1,R1                                                            
         L     R6,0(,R4)           Load keyword                                 
         IC    R1,0(,R7)           Get full length of level                     
         BAS   RE,SETENTRY                                                      
         AH    R1,SJADJMNT                                                      
         STH   R1,HALF             Total of all accts so far                    
*                                                                               
         SR    R1,R1                                                            
         SR    R3,R3               R3 = Total of levels since last lvl          
         LA    R0,9                Full account and 9 possible levels           
SETAE60  LA    R4,4(,R4)           Bump to next keyword address                 
         L     R6,0(,R4)           Load keyword                                 
         LA    R7,1(,R7)           Next level length of Acct. Equiv.            
         SR    R3,R3                                                            
         IC    R3,0(,R7)           Get length of level                          
         STC   R3,KYWLVLQ          Set for LVL attribute                        
         CLI   0(R7),EOT           Any more levels ?                            
         BNE   *+6                 Yes                                          
         SR    R1,R1               No, reset to zero                            
         AR    R1,R3                                                            
         BAS   RE,SETENTRY                                                      
         BCT   R0,SETAE60                                                       
*                                                                               
         MVC   SJADJMNT,HALF       Set for next group of equiv.                 
         LA    R7,1(,R7)                                                        
         LA    R4,4(,R4)           Bump to next keyword address                 
         B     SETAE50             Process next set of keywords                 
*                                                                               
SETAE90  CLI   MODE,RUNFRST                                                     
         BNE   SETAEVX                                                          
         LH    R3,SJADJMNT         R3 = Total level amounts                     
         AHI   R3,SJINFQ           Fixed length of entry                        
         STH   R3,SJLNQ            Set length of SJINFO entry                   
         L     RF,ASJMAXQ          Load length of table                         
         SR    RE,RE                                                            
