SETENTX  XIT1                                                                   
         DROP  R2,R3,R6                                                         
         EJECT                                                                  
***********************************************************************         
*                                                                               
***********************************************************************         
         USING KYWD,R6                                                          
POSTKYW  NTR1                                                                   
         L     R2,=A(KYWPOST)                                                   
         L     R6,=A(KYWUFLD)                                                   
         OI    KYWIND1,KYWUNQ                                                   
         CLI   QPROG,PRODUCTION                                                 
         BNE   *+8                                                              
         NI    KYWIND1,TURNOFF-KYWUNQ                                           
*                                                                               
POSTKYW3 CLI   0(R2),EOT           End of keywords                              
         BE    POSTKYW9                                                         
         ICM   R6,15,0(R2)                                                      
         A     R6,KYWBASE                          POINT TO KEYWORD             
         NI    KYWIND3,TURNOFF-(KYWTRNS+KYWSUBA)   DEFAULT TO POSTACC           
         MVC   WORK(4),CURLDGR                                                  
         NC    WORK(4),4(R2)                       IS IT THIS LEDGER?           
         BZ    *+10                                                             
         OC    KYWIND3,8(R2)       TURN ON POST MODE                            
         SR    R3,R3                                                            
         ICM   R3,3,KYWLINK        GET LINK TO OTHER ENTRY IF ANY?              
         BZ    POSTKYW6                                                         
         L     R6,KYWBASE                                                       
         AR    R6,R3                               POINT TO KEYWORD             
         NI    KYWIND3,TURNOFF-(KYWTRNS+KYWSUBA)   DEFAULT TO POSTACC           
         NC    WORK(4),4(R2)                       IS IT THIS LEDGER?           
         BZ    *+10                                                             
         OC    KYWIND3,8(R2)       TURN ON POST MODE                            
POSTKYW6 LA    R2,9(,R2)                                                        
         B     POSTKYW3                                                         
POSTKYW9 XIT1                                                                   
         DROP  R6                                                               
         EJECT ,                                                                
***********************************************************************         
*  Fix lengths on parse entreis                                       *         
***********************************************************************         
         SPACE 1                                                                
         USING PARSED,R4                                                        
FIXLEN   CLI   PARTYPE,EOT         ANY MORE ENTRIES?                            
         BER   RE                                                               
*&&UK                                                                           
         TM    PARIND4,PARXADJ     TEST DON'T ADJUST THIS ONE                   
         BNZ   FIXL02                                                           
*&&                                                                             
         STH   R1,PARTOLEN         ADJUST TO LENGTH                             
         STH   R1,PARFRLEN                                                      
FIXL02   LA    R4,PARSEDQ(,R4)     BUMP TO NEXT POSSIBLE PARSE ENTRY            
         J     FIXLEN                                                           
         EJECT ,                                                                
***********************************************************************         
*  Fix displacements on parse entries                                 *         
*  R4 = parse entry, R0 amount to adjust                              *         
***********************************************************************         
                                                                                
FIXDSP   ICM   R0,15,0(R1)         Any more entries ?                           
         BZR   RE                  Nothing to adjust                            
         MVC   BYTE,7(R1)          Single or multiple                           
FIXDSPA  CLI   PARTYPE,EOT         Any more entries ?                           
         BER   RE                  No                                           
         SR    R5,R5                                                            
         TM    PARIND2,PARFDSP     Only fix entries marked                      
         JZ    FIXDSP40            Not marked so skip                           
                                                                                
         ST    RE,SVRE                                                          
         GOTOR SAVEPRS,(R4)                                                     
         L     RE,SVRE                                                          
                                                                                
         CLI   PARTYPE,STORAGE     Fix S() type displacements                   
         JNE   FIXDSP10                                                         
         ICM   R5,3,PARBASE                                                     
         AR    R5,R0               Add in displacement                          
         STCM  R5,3,PARBASE                                                     
         J     FIXDSP40                                                         
*                                                                               
FIXDSP10 CLI   PARTYPE,ELEMENT     Fix Y(0) displacement                        
         JE    FIXDSP20                                                         
         CLI   PARTYPE,ELMTYPE     Fix Y(0) displacement                        
         JE    FIXDSP20                                                         
         CLI   PARTYPE,KEYTYPE     Fix Y(0) displacement                        
         JNE   FIXDSP40                                                         
                                                                                
FIXDSP20 LH    R5,PARDSPEL         Load starting displacement                   
         AR    R5,R0               Add in adjustment                            
         STH   R5,PARDSPEL         Save new starting displacement               
*                                                                               
FIXDSP40 CLI   BYTE,1              Bump to next possible parse entry            
         BER   RE                  No, fix single entry only                    
         LA    R4,PARSEDQ(,R4)     Bump to next possible parse entry            
         J     FIXDSPA             Next                                         
         DROP  R4                                                               
         EJECT ,                                                                
***********************************************************************         
* Save off part of parse entry that needs to be re-set between runs             
***********************************************************************         
         USING ADJD,RF                                                          
         USING PARSED,R1                                                        
SAVEPRS  L     RF,AADJPOOL         Pool of adjustments (pointer)                
         TM    PARIND2,PARFDSP     Only fix entries marked                      
         JZ    SAVEPRSX            Not marked so skip                           
         ST    R1,ADJENTRY         Save parse entry address                     
         MVC   ADJMODE,MODE        Save mode that it is saved in                
         CLI   PARTYPE,STORAGE     Fix S() type displacements                   
         JNE   SAVPRS20                                                         
         MVC   ADJORGIN,PARBASE    Save off original value                      
         J     SAVPRS80                                                         
                                                                                
SAVPRS20 CLI   PARTYPE,ELEMENT     Fix Y(0) displacement                        
         JE    SAVPRS30                                                         
         CLI   PARTYPE,ELMTYPE     Fix Y(0) displacement                        
         JE    SAVPRS30                                                         
         CLI   PARTYPE,KEYTYPE     Fix Y(0) displacement                        
         JNE   SAVEPRSX                                                         
                                                                                
SAVPRS30 MVC   ADJORGIN,PARDSPEL   Save off original value                      
                                                                                
SAVPRS80 AHI   RF,ADJLNQ           Bump up entry                                
         ST    RF,AADJPOOL         Store new location for next                  
         XC    0(ADJLNQ,RF),0(RF)  Clear next entry for end                     
                                                                                
SAVEPRSX BR    RE                                                               
         DROP  R1,RF                                                            
         EJECT ,                                                                
***********************************************************************         
* Restore portion of parse entry that was changed in TABRUN or TABREQ *         
* R1 = ADJUST TAB for RUNFIRST OR REQFIRST                                      
***********************************************************************         
         USING ADJD,RF                                                          
         USING PARSED,R1                                                        
RESETPRS L     RF,AADJPOOL         Reset some parse entries                     
RESPRS10 ICM   R1,15,ADJENTRY                                                   
         BZR   RE                  Finished                                     
         CLC   ADJMODE,MODE        Match mode                                   
         JNE   RESPRS80                                                         
         CLI   PARTYPE,STORAGE                                                  
         JNE   *+10                                                             
         MVC   PARBASE,ADJORGIN    Reset S() value                              
*                                                                               
         CLI   PARTYPE,ELEMENT                                                  
         JE    RESPRS20                                                         
         CLI   PARTYPE,ELMTYPE                                                  
         JE    RESPRS20                                                         
         CLI   PARTYPE,KEYTYPE                                                  
         JNE   *+10                                                             
RESPRS20 MVC   PARDSPEL,ADJORGIN   Reset Y() displacement                       
                                                                                
RESPRS80 AHI   RF,ADJLNQ                                                        
         J     RESPRS10                                                         
         DROP  R1,RF                                                            
         EJECT ,                                                                
