***********************************************************************         
*   GET LOW/HIGH CORE STORAGE AND DIVIDE UP THE TABLES                *         
***********************************************************************         
         SPACE 1                                                                
         LA    R2,TABLES           TABLES TO CREATE                             
         MVC   ASJMAXQ,=A(MAXSJQ)                                               
         TM    LOADMODE,LOADINT                                                 
         BZ    LOAD40                                                           
                                                                                
         SR    R0,R0               R0 = TOTAL SPACE IN LOW  CORE                
         SR    R4,R4               R1 = TOTAL SPACE IN HIGH CORE                
LOAD05   CLI   0(R2),EOT           END OF TABLE                                 
         JE    LOAD10                                                           
         L     R6,LOADSIZE                                                      
         CLI   SOONJOB,YES         IS IT A SOON JOB ?                           
         BNE   LOAD07              NO                                           
         TM    LOADIND,LOADSML     REDUCE TABLE SIZE BY 1/2                     
         BZ    LOAD07              NO                                           
         SRL   R6,1                DIVIDE BY TWO                                
         ST    R6,LOADSIZE         CHANGE SIZE, OK TO DO SINCE SOONS            
         CLC   LOADLABL,=C'**SJTB**'                                            
         BNE   *+8                                                              
         ST    R6,ASJMAXQ                                                       
*                                  ONLY RUN ONE JOB AT A TIME                   
LOAD07   AHI   R6,8                8 FOR LABLE                                  
         TM    LOADSIZE+3,X'03'    SEE IF MULTIPLE OF 4 FOR ALIGNMENT           
         BZ    LOAD08                                                           
         AHI   R6,4                                                             
         SRL   R6,2                                                             
         SLL   R6,2                MULTIPLE OF FOUR NOW                         
*                                                                               
LOAD08   TM    LOADIND,LOADHIGH                                                 
         BZ    LOAD09                                                           
         AR    R4,R6               HIGH CORE TABLE SIZE                         
         B     LOAD09A                                                          
*                                                                               
LOAD09   AR    R0,R6               LOW  CORE TABLE SIZE                         
LOAD09A  AHI   R2,LOADLNQ          BUMP UP IN TABLE                             
         B     LOAD05                                                           
*                                                                               
LOAD10   AHI   R0,4                EXTRA FOR ALIGNMENT                          
         ST    R0,LOADTOTL                                                      
         GETMAIN R,LV=(0)          GET SOME STORAGE                             
         ST    R1,LOADADRL         A(LOW CORE BLOCK)                            
*                                                                               
         USING MASTD,R5                                                         
         L     R5,ADMASTC                                                       
         C     R1,MCUSRDMP                                                      
         BNL   *+8                                                              
         ST    R1,MCUSRDMP                                                      
         DROP  R5                                                               
*                                                                               
         LTR   R0,R4                                                            
         BZ    LOAD12                                                           
         AHI   R0,4                EXTRA FOR ALIGNMENT                          
         ST    R0,LOADTOTH                                                      
         GETMAIN RU,LV=(0),LOC=(ANY,ANY)    GET SOME STORAGE                    
         ST    R1,LOADADRH         A(HIGH CORE BLOCK)                           
*                                                                               
LOAD12   LA    R2,TABLES                                                        
*                                                                               
LOAD15   CLI   0(R2),EOT           END OF TABLE?                                
         BE    LOAD40                                                           
         L     R1,LOADADRL         LOW AREA                                     
         TM    LOADIND,LOADHIGH    HIGH AREA NEEDED ?                           
         BZ    *+8                                                              
         L     R1,LOADADRH         HIGH AREA                                    
         ST    R1,FULL                                                          
         TM    FULL+3,X'03'        SEE IF MULTIPLE OF 4 FOR ALIGNMENT           
         BZ    LOAD20                                                           
         AHI   R1,4                                                             
         SRL   R1,2                                                             
         SLL   R1,2                MULTIPLE OF FOUR NOW                         
*                                                                               
LOAD20   MVC   0(L'LOADLABL,R1),LOADLABL                                        
         AHI   R1,8                MOVE PAST LABLE                              
         LR    R3,RA               ADD BASE ACRLD                               
         AH    R3,LOADAVAR         ADDRESS VARIABLE                             
         ST    R1,0(,R3)           SAVE ADDRESS VARIABLE                        
         ST    R1,LOADADDR         SAVE ADDRESS IN TABLE ALSO                   
         A     R1,LOADSIZE         BUMP TO NEXT FREE AREA                       
         LA    RE,LOADADRL                                                      
         TM    LOADIND,LOADHIGH    HIGH CORE ?                                  
         BZ    *+8                                                              
         LA    RE,LOADADRH                                                      
         ST    R1,0(,RE)           SAVE OF NEW ADDRESS                          
*                                                                               
         USING MASTD,R5                                                         
         TM    LOADIND,LOADHIGH                                                 
         BO    LOAD22              IGNORE HIGH CORE DUMP                        
         TM    LOADIND,LOADDUMP    DUMP UPTO HERE IF DIED                       
         BZ    LOAD22                                                           
         L     R5,ADMASTC                                                       
         L     R1,LOADADRL         End of low core                              
         C     R1,MCUSRDMP+4                                                    
         BNH   *+8                                                              
         ST    R1,MCUSRDMP+4                                                    
         DROP  R5                                                               
*                                                                               
LOAD22   AHI   R2,LOADLNQ                                                       
         B     LOAD15                                                           
