         DC    AL1(EOT)                                                         
         TITLE 'Set contra levels in parse entries'                             
***********************************************************************         
*  P1 = A(UNIT/LEDGER)                                                *         
***********************************************************************         
         USING LDGD,R4                                                          
         USING ACRLD,RA                                                         
         USING ACRL2D,R7                                                        
         USING ACWORKD,RC                                                       
SETCON   NMOD1 0,**SCON**                                                       
         L     RC,RLBASEC                                                       
         L     R7,AACRL2D                                                       
         L     R2,0(,R1)                                                        
         MVI   ONLYCULA,NO                                                      
         CLC   SVCUL,0(R2)         Same contra unit/ledger ?                    
         BNE   SETCON04                                                         
         CLC   SVCULA,0(R2)        Same account as last time in ?               
         BE    SETCONX             Yes, so don't set again                      
         MVI   ONLYCULA,YES        Set CNTRALVS area                            
*                                                                               
SETCON04 MVC   SVCULA,0(R2)                                                     
         MVC   CNTRALVS,SPACES     Reset area. Contra by level                  
         CLC   0(2,R2),SPACES      Is there a contra to set ?                   
         BH    SETCON10            Yes                                          
         XC    0(4,R1),0(R1)       No, set to no ledger                         
         B     SETCON12                                                         
*                                                                               
SETCON10 GOTO1 GETLDGR             Same parameter as SETCON                     
                                                                                
SETCON12 LA    R0,4                                                             
         SR    RF,RF               Set default                                  
         SR    R5,R5               Use if not a ledger                          
         LA    RE,CONTRAS                                                       
         ICM   R4,15,0(R1)         R1 = A(Ledger table entry)                   
         BZ    SETCON20            Not a ledger so set all to LEN=12            
         LA    R3,CNTRALVS                                                      
         LA    R5,LDGLEV1          Level lengths                                
         CLI   ONLYCULA,YES                                                     
         BE    SETCON22                                                         
         DROP  R4                                                               
*                                                                               
         USING KYWD,R6                                                          
SETCON20 L     R6,0(RE)            POINT TO KEYWORD ENTRY FOR CONTRA            
         A     R6,KYWBASE                                                       
         MVI   KYWLVLQ,0           RESET                                        
         LTR   R5,R5                                                            
         BZ    SETCON25                                                         
         MVC   KYWLVLQ,1(R5)       SAVE LEN OF THIS LEVEL ONLY                  
                                                                                
SETCON22 SR    RF,RF                                                            
         ICM   RF,1,0(R5)          LEVEL LENGTH                                 
         BZ    SETCON25                                                         
         LA    RF,1(,RF)           ADD 2 FOR UNIT/LEDGER, LESS 1 FOR EX         
         EXMVC RF,0(R3),0(R2)                                                   
         LA    R3,L'CNTRALV1(,R3)                                               
                                                                                
SETCON25 CLI   ONLYCULA,YES        Set conta levels only ?                      
         BE    SETCON50            Yes                                          
*                                                                               
         USING PARSED,R4                                                        
         SR    R4,R4                                                            
         ICM   R4,3,KYWPRSE        GET PARSE ENTRY                              
         BZ    SETCON40                                                         
         A     R4,PRSBASE                                                       
*                                                                               
         SR    RF,RF               SET DEFAULT                                  
         LTR   R5,R5                                                            
         BZ    SETCON30            SET AS IF ZERO                               
         CLI   0(R5),0             LENGTH OF LEVEL                              
         BE    SETCON30                                                         
         IC    RF,0(R5)            LENGTH OF LEDGER                             
         LA    RF,2(,RF)           ADD IN UNIT/LEDGER                           
SETCON30 CLI   0(R4),EOT           END OF TABLE                                 
         BE    SETCON40                                                         
         STH   RF,PARFRLEN                                                      
         STH   RF,PARTOLEN                                                      
         LA    R4,PARSEDQ(,R4)     NEXT PARSE TABLE ENTRY                       
         B     SETCON30                                                         
*                                                                               
SETCON40 LA    RE,4(,RE)           BUMP TO NEXT KEYWORD                         
                                                                                
SETCON50 LTR   R5,R5                                                            
         BZ    *+8                                                              
         LA    R5,LDGLEV2-LDGLEV1(,R5)  BUMP UP LEGDER LEVEL ENTRY              
         LA    RF,SETCON20                                                      
         CLI   ONLYCULA,YES                                                     
         BNE   *+8                                                              
         LA    RF,SETCON22                                                      
         BCTR  R0,RF                    LOOP                                    
*                                                                               
SETCONX  XMOD1 1                                                                
         DROP  R2,R4,R6,R7                                                      
         SPACE 2                                                                
         LTORG                                                                  
         SPACE 2                                                                
ONLYCULA DS    CL1                 Yes/No set contra levels only                
SVCUL    DS    0CL2                                                             
SVCULA   DS    CL14                                                             
                                                                                
CONTRAS  DC    A(KYWCAC1-KYWDTAB)                                               
         DC    A(KYWCAC2-KYWDTAB)                                               
         DC    A(KYWCAC3-KYWDTAB)                                               
         DC    A(KYWCAC4-KYWDTAB)                                               
         TITLE 'BUILD LIST OF LEDGERS AND THEIR LEVEL DATA'                     
***********************************************************************         
*  BUILD LIST OF LEDGER INFORMATION                                   *         
***********************************************************************         
         USING ACWORKD,RC                                                       
         USING ACRLD,RA                                                         
         USING LDGRECD,R2                                                       
         USING LDGD,R3                                                          
LDGLIST  DS    0D                                                               
         NMOD1 0,**LEVEL*                                                       
         L     RC,RLBASEC                                                       
         LR    R6,R1               SAVE PARAMETER ADDRESS                       
         L     R4,0(,R1)           POINT AT UNIT/LEDGER WE WANT                 
         L     R3,LDGBASE                                                       
         LA    R0,MAXLDG#                                                       
LDGLST10 CLI   0(R3),0             END OF TABLE                                 
         BE    LDGLST20                                                         
         CLC   LDGUL,0(R4)         MATCH ON UNIT/LEDGER                         
         BE    LDGLST98            FOUND SO RETURN ADDRESS                      
*&&US*&& AHI   R3,LDGLENQ          BUMP UP IN TABLE                             
*&&UK*&& AHI   R3,LDGLEN2Q         BUMP UP IN TABLE                             
         BCT   R0,LDGLST10                                                      
         DC    H'00'               Table full                                   
*                                                                               
LDGLST20 LA    R2,IOKEY                                                         
         MVI   LDGFLAG,NO                                                       
         MVC   LDGKEY,SPACES                                                    
         MVC   LDGKCPY,RCCOMPFL    COMPANY CODE                                 
         MVC   LDGKUNT(2),0(R4)    GET UNIT LEDGER                              
         L     R1,=AL4(IOREAD+IOACFIL+IOAREA3)                                  
         GOTO1 AIO                                                              
         BNE   LDGLST95                                                         
         L     R2,AIO3                                                          
         AH    R2,DATADISP                                                      
         SR    RF,RF                                                            
         XC    LDGUL(LDGLENQ),LDGUL  CLEAR ENTRY                                
         MVC   LDGNAME,SPACES                                                   
*&&US*&& MVI   LDGLENQ(R3),0       MARK END OF TABLE                            
*&&UK*&& MVC   LDGAECDS(LDGLEN2Q-LDGLENQ),SPACES                                
*&&UK*&& MVI   LDGLEN2Q(R3),0      MARK END OF TABLE                            
*                                                                               
LDGLST22 CLI   0(R2),0                                                          
         BE    LDGLST95                                                         
         CLI   0(R2),LDGELQ        X'14' LEDGER ELEMENT                         
         BE    LDGLST30                                                         
         CLI   0(R2),ACLELQ        X'16' LEVEL LEDGER STRUCTURE                 
         BE    LDGLST40                                                         
         CLI   0(R2),NAMELQ        X'20' LEDGER NAME                            
         BE    LDGLST60                                                         
         CLI   0(R2),APRELQ        X'CA' Account equiv. rules                   
         BE    LDGLST70                                                         
*&&UK*&& CLI   0(R2),FFTELQ        X'DB' Freeform test                          
*&&UK*&& BE    LDGLST80                                                         
LDGLST24 SR    RF,RF                                                            
         IC    RF,1(,R2)                                                        
         AR    R2,RF                                                            
         B     LDGLST22                                                         
*                                                                               
         USING LDGELD,R2                                                        
LDGLST30 MVC   LDGCLIP,LDGCPOS     CLIENT POSITION IF ANY                       
         CLI   LDGCLIP,0                                                        
         BNZ   LDGLST32                                                         
*&&UK*&& CLC   =CL2'1C',0(R4)                                                   
*&&UK*&& BE    *+14                                                             
         CLC   =CL2'SR',0(R4)                                                   
         BNE   LDGLST32                                                         
         MVI   LDGCLIP,1           ASSUME POSITION 1 IF NOT SET                 
                                                                                
LDGLST32 MVC   LDGOFFP,LDGOPOS     OFFICE POSITION IF ANY                       
         B     LDGLST24                                                         
*                                                                               
         USING ACLELD,R2                                                        
LDGLST40 LA    R1,1                                                             
         MVI   LDGFLAG,YES         THIS ONE OK                                  
         MVC   LDGUL,0(R4)         SAVE OFF UNIT LEDGER                         
         SR    RF,RF                                                            
         IC    RF,ACLLN            GET LENGTH                                   
         SHI   RF,ACLLN1Q                                                       
         SRL   RF,4                DIVIDE BY 16                                 
         LA    RE,LDGLEV1                                                       
         LR    R5,R2                                                            
         AHI   R5,ACLLN1Q                                                       
*                                                                               
         USING ACLVALS,R5                                                       
LDGLST45 CLI   ACLVLEN,0           CHECK OUT THE LENGTH                         
         BE    LDGLST50            FINISHED                                     
         STC   R1,LDG#LEVS         SAVE NUMBER OF LEVELS                        
         MVC   0(1,RE),ACLVLEN                                                  
         MVC   2(15,RE),ACLVDESC   SAVE NAME                                    
         LA    RE,LDGLEV3-LDGLEV2(RE)                                           
         LA    R1,1(R1)            COUNT THE LEVELS                             
         AHI   R5,L'ACLVALS        BUMP UP TO NEXT LEVEL                        
         BCT   RF,LDGLST45                                                      
*                                                                               
LDGLST50 MVC   LDGLVQ1,LDGLEV1                                                  
         ZIC   R1,LDGLEV1                                                       
         ZIC   R5,LDGLEV2                                                       
         SR    R5,R1               LEVEL2-LEVEL1                                
         BNP   LDGLST24                                                         
         STC   R5,LDGLVQ2          SAVE LENGTH OF SINGLE LEVEL                  
*                                                                               
         IC    R1,LDGLEV2                                                       
         ZIC   R5,LDGLEV3                                                       
         SR    R5,R1               LEVEL3-LEVEL2                                
         BNP   LDGLST24                                                         
         STC   R5,LDGLVQ3          SAVE LENGTH OF SINGLE LEVEL                  
*                                                                               
         IC    R1,LDGLEV3                                                       
         IC    R5,LDGLEV4                                                       
         SR    R5,R1               LEVEL4-LEVEL3                                
         BNP   LDGLST24                                                         
         STC   R5,LDGLVQ4          SAVE LENGTH OF SINGLE LEVEL                  
         B     LDGLST24                                                         
*                                                                               
         USING NAMELD,R2                                                        
LDGLST60 SR    R1,R1                                                            
         IC    R1,NAMLN                                                         
         SHI   R1,NAMELQ+1                                                      
         BM    LDGLST24                                                         
         EXMVC R1,LDGNAME,NAMEREC     MOVE IN NAME                              
         B     LDGLST24                                                         
         USING APRELD,R2                                                        
LDGLST70 SR    RE,RE                                                            
         IC    RE,APRSEQ           Which pointer 1 - 5                          
         MHI   RE,LDGAE_B-LDGAE_A    5 entries 10 bytes each                    
         LA    RE,LDGAELVS(RE)     Start of 5 entries                           
         MVC   0(1,RE),APRTLEN     Save total length                            
         LA    RE,1(,RE)           1st byte is total length                     
         SR    R1,R1                                                            
         IC    R1,APRNLEVS         Number of levels                             
         LA    RF,APRMLEN                                                       
         SR    R5,R5                                                            
*                                                                               
LDGLST72 IC    R5,0(,RF)           Get  length of level                         
         STC   R5,0(,RE)           Save length of level                         
         LA    RE,1(,RE)           Next entry in LDGAEA                         
         LA    RF,1(R5,RF)         Next mini-entry in element                   
         BCT   R1,LDGLST72                                                      
         B     LDGLST24                                                         
*&&UK                                                                           
         USING FFTELD,R2                                                        
LDGLST80 CLI   FFTTYPE,FFTTEPTR    Freeform Acct equivalent                     
         BNE   LDGLST24                                                         
         SR    RE,RE                                                            
         IC    RE,FFTSEQ           Get which one                                
         MHI   RE,L'LDGAECDS                                                    
         LA    RE,LDGAECDS(RE)     Point to acct. equiv. location               
         SR    RF,RF                                                            
         IC    RF,FFTDLEN                                                       
         SHI   RF,1                                                             
         BNP   LDGLST24                                                         
         EXMVC RF,0(RE),FFTDATA                                                 
         B     LDGLST24                                                         
*&&                                                                             
LDGLST95 CLI   LDGFLAG,YES                                                      
         BE    LDGLST98                                                         
         SR    R3,R3               SET TO NOT FOUND                             
LDGLST98 ST    R3,0(,R6)           SAVE ADDRESS                                 
         XMOD1                                                                  
