***********************************************************************         
*                    SEE DSECT "PARSED" in ACREPRLWRK                 *         
***********************************************************************         
*        PARSE TABLE - TO EXTRACT DATA FROM KEYS, ELEMENTS, STORAGE   *         
*                      OR OTHER AREAS.                                *         
*           1) TYPE OF PARSE OPERATION                        AL1(0)  *         
*                "STORAGE" = LA  AND  MVC                             *         
*                "ELEMENT" = GET ELEMENT AND ADD DISPLACEMENT         *         
*                "KEYTYPE" = L ADDRESS, ADD DISPLACEMENT, MVC         *         
*                "ELMTYPE" = L ADDRESS, ADD DISPLACEMENT, MVC         *         
*                "CODE"    = L ADDRESS TO BRANCH TO                   *         
*           2) ELEMENT # ELSE ZERO                            AL1(0)  *         
*           3) POINTER TO AN ADDRESS                          S(0)    *         
*                IF (A) STORAGE TYPE THEN ACTUAL STORAGE LABEL        *         
*                   (B) ELEMENT OR KEY TYPE THEN AN ADDRESS TO THE    *         
*                       IO AREA WHERE THE ELEMENT OR KEY RESIDE       *         
*                   (C) CODE TYPE THEN LABEL TO BRANCH TO             *         
*           4) ADJUSTMENT AMOUNT TO POINT TO START OF KEY     H(0)    *         
*           5) DISPLACEMENT TO DATA IN KEY OR ELEMENT         Y(0)    *         
*           6) DISPLACEMENT TO SPECIAL TEST DATA IN KEY/ELEM  Y(0)    *         
*           7) LENGTH OF SOURCE DATA OR                       AL2(0)  *         
*              IF DATE TYPE THEN DATCON CONVERSION TYPE # OF SOURCE   *         
*           8) LENGTH OF DESTINATION OR                       AL2(0)  *         
*              IF DATE TYPE THEN DATCON CONVERSION TYPE # OF DEST.    *         
*           9) SOURCE DATA TYPE TO CONVERT FROM               AL1(0)  *         
*          10) DESTINATION DATA TYPE TO CONVERT TO            AL1(0)  *         
*              (A) CHAR = CHARACTER,  (B) PACK = PACKED NUMBER        *         
*              (C) DATETYPE = DATE    (D) BINARY                      *         
*          11) VALIDATE TEST CHARACTER OR IF VALCODE -X'FF'   AL1(0)  *         
*              THEN BRANCH TO VALIDATION CODE                         *         
*          12) VALIDATION ACTION - TO EXCEPT IF VALID         AL1(0)  *         
*          13) VALIDATION CODE - EITHER CODE TO BRANCH TO OF  A(0)    *         
*              CONDITIONAL STATEMENT TO TEST CHARACTER WITH           *         
***********************************************************************         
         SPACE 1                                                                
         USING POD,CURPODET                                                     
         USING POWCD,CURPOWC                                                    
         USING FMTRECD,R5                                                       
PRSETAB  DS    0F                                                               
         DC    A(0)                FORCE FIRST ENTRY DISP <> 0                  
PRSACCC  DS    0F                                                               
         DC    AL1(KEYTYPE),X'00',S(ADACC)                                      
         DC    AL1(PARBUD,0,0,0),AL4(0)                                         
         DC    Y(ACTKACT-ACTRECD,0)                                             
         DC    AL2(L'ACTKACT,L'ACTKACT),AL1(CHAR,CHAR)                          
         DC    AL1(0,0,0,0),A(0)                                                
         DC    AL1(EOT)            END OF ENTRIES                               
*++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++         
PRSACCN  DS    0F                                                               
         DC    AL1(ELEMENT),X'20',S(ADACC)                                      
         DC    AL1(PARBUD,PAREXNM,0,0),AL4(0)                                   
         DC    Y(NAMEREC-NAMELD,0)                                              
         DC    AL2(0,36),AL1(CHAR,CHAR)                                         
         DC    AL1(0,0,0,0),A(0)                                                
         DC    AL1(EOT)            END OF ENTRIES                               
*++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++         
         SPACE 1                                                                
